"use strict";(self.webpackChunkway23=self.webpackChunkway23||[]).push([[7552],{64111:(s,n,e)=>{e.r(n),e.d(n,{data:()=>a});const a={key:"v-91d12976",path:"/linux-cmp.html",title:"Сравнение файлов в Linux (cmp)",lang:"ru-RU",frontmatter:{title:"Сравнение файлов в Linux (cmp)",date:"2023-12-05",categories:["Linux"],tags:["cmp"]},excerpt:"",headers:[],filePathRelative:"linux-cmp.md",git:{updatedTime:1701789233e3}}},76619:(s,n,e)=>{e.r(n),e.d(n,{default:()=>c});var a=e(66252),l=e(3577);const t={id:"frontmatter-title",tabindex:"-1"},p=(0,a._)("a",{class:"header-anchor",href:"#frontmatter-title","aria-hidden":"true"},"#",-1),r=(0,a.uE)('<p>Команда <code>cmp</code> сравнивает два файла и выдаёт есть ли между ними различия. Для примеров используем несколько файлов:</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code>user@debian-server:~/test$ <span class="token function">cat</span> file1.txt \nabcdef\nuser@debian-server:~/test$ <span class="token function">cat</span> file2.txt \nabcdef\nuser@debian-server:~/test$ <span class="token function">cat</span> file3.txt \nabcdefgh\nuser@debian-server:~/test$ <span class="token function">cat</span> file4.txt \nabzdwf\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br></div></div><p>Если два файла полностью совпадают, то команда ничего не возвращает.</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code>user@debian-server:~/test$ <span class="token function">cmp</span> file1.txt file2.txt \nuser@debian-server:~/test$ \n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br></div></div><p>В случае если один файл больше другого и начальная часть большего файла совпадает с меньшим файлом <code>cmp</code> выдаст сообщение о том, что меньший файл закончился (EOF — End Of File).</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code>user@debian-server:~/test$ <span class="token function">cmp</span> file1.txt file3.txt \ncmp: EOF on file1.txt after byte <span class="token number">6</span>, <span class="token keyword">in</span> line <span class="token number">1</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br></div></div><p>Если в файлах есть различие, то <code>cmp</code> остановится на первом различающемся байте и выдаст сообщение с его номером.</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code>user@debian-server:~/test$ <span class="token function">cmp</span> file1.txt file4.txt \nfile1.txt file4.txt differ: byte <span class="token number">3</span>, line <span class="token number">1</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br></div></div><p>С параметром <code>-b</code> команда <code>cmp</code> выведет значения различающегося байта.</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code>user@debian-server:~/test$ <span class="token function">cmp</span> -b file1.txt file4.txt \nfile1.txt file4.txt differ: byte <span class="token number">3</span>, line <span class="token number">1</span> is <span class="token number">143</span> c <span class="token number">172</span> z\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br></div></div><p>А с параметром <code>-l</code> весь список различающихся байт.</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code>user@debian-server:~/test$ <span class="token function">cmp</span> -l file1.txt file4.txt \n<span class="token number">3</span> <span class="token number">143</span> <span class="token number">172</span>\n<span class="token number">5</span> <span class="token number">145</span> <span class="token number">167</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br></div></div><p>Параметры можно скомбинировать</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code>user@debian-server:~/test$ <span class="token function">cmp</span> -lb file1.txt file4.txt \n<span class="token number">3</span> <span class="token number">143</span> c    <span class="token number">172</span> z\n<span class="token number">5</span> <span class="token number">145</span> e    <span class="token number">167</span> w\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br></div></div>',14),c={render:function(s,n){return(0,a.wg)(),(0,a.iD)(a.HY,null,[(0,a._)("h1",t,[p,(0,a.Uk)(" "+(0,l.zw)(s.$frontmatter.title),1)]),r],64)}}}}]);